import React, {Component} from 'react';
import Style from "../Strategy/Strategy.module.scss";
import StyleUpdating from "../Updating/Updating.module.scss";
import ImageArgent from "../Updating/argent.png";
import ImageTemps from "../Updating/montre_circulaire.png";

class Banque extends Component {
    render() {
        return (
            <section className={Style.none4}>
                <div className="text-center">
                    <header className={Style.header}>
                        Banque
                    </header>
                    <div className={Style.header2}>
                        Compte Courant : {this.props.pseudo}
                    </div>
                    <div className="row text-center">
                        <div className="col-sm-6">
                            <h2 className={StyleUpdating.TextBanque}>
                                <img className={StyleUpdating.Image} src={ImageArgent}/> UB : {this.props.ub}
                            </h2>
                        </div>
                        <div className="col-sm-6">
                            <h2 className={StyleUpdating.TextBanque}>
                                <img className={StyleUpdating.Image} src={ImageTemps}/> UT : {this.props.ut}
                            </h2>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-sm-6">
                            <header className={Style.header2}>
                                Effectuer un virement
                            </header>
                        </div>
                        <div className="col-sm-6">
                            <header className={Style.header2}>
                                Recevoir de l'argent
                            </header>
                        </div>
                    </div>
                </div>
                <button className={Style.banque} onClick={this.props.retour}>Retour</button>
            </section>
        );
    }
}

export default Banque;
